import { Component, OnInit, ViewChild, ElementRef } from '@angular/core';
import { ReciboService } from '../../../../../services/recibo.service';
import { UtilService } from '../../../../../services/util.service';
import { FormGroup, FormBuilder} from '@angular/forms';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';

pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-relatorio-visualizacoes',
  templateUrl: './relatorio-visualizacoes.page.html',
  styleUrls: ['./relatorio-visualizacoes.page.scss'],
})
export class RelatorioVisualizacoesPage implements OnInit {
  public formGroup: FormGroup;
  loading = false;
  visualizado: any;
  ano: any;
  mes: any;
  matricula: any;
  relatorioCollection: any[] = [];
  funcionarioCollection: any[] = [];
  funcionarioCollectionClone: any[] = [];
  palavra: string;

  @ViewChild('pdfContent') pdfContent: ElementRef;

  constructor(
    private reciboService: ReciboService,
    private utilService: UtilService,
    public formBuilder: FormBuilder
  ) { }

  ngOnInit() {}

  loadRelatorio() {
    this.loading = true;
    this.reciboService.listarVisualizacao(this.mes, this.ano)
      .then((response: any) => {
        this.loading = false;
        this.relatorioCollection = response.data;
      })
      .catch((erro) => {
        this.loading = false;
        console.log(erro);
      });
  }

  getNomeMes(numeroMes: number): string {
    const meses = [
      'Janeiro', 'Fevereiro', 'Março', 'Abril',
      'Maio', 'Junho', 'Julho', 'Agosto',
      'Setembro', 'Outubro', 'Novembro', 'Dezembro'
    ];

    return meses[numeroMes - 1] || '';
  }

  filtrarPorMatricula(matricula: string) {
    if (matricula) {
      return this.relatorioCollection.filter(resultado => resultado.matricula === matricula);
    } else {
      return this.relatorioCollection; // Retorna a coleção completa se a matrícula não estiver definida
    }
  }

  filtrar(evt) {
    this.funcionarioCollection = this.funcionarioCollectionClone;
    const searchTerm = evt.srcElement.value;

    if (!searchTerm) {
      return;
    }

    this.funcionarioCollection = this.funcionarioCollection.filter((c) => {
      if (searchTerm) {
        if (
          c.matricula.toLowerCase().indexOf(searchTerm.toLowerCase()) > -1 ||
          c.nome.toLowerCase().indexOf(searchTerm.toLowerCase()) > -1
        ) {
          return true;
        }
        return false;
      }
    });
  }

  gerarPDF() {
    pdfMake.vfs = pdfFonts.pdfMake.vfs;

    const docContent = [];

    docContent.push({
      alignment: 'center',
      image: 'data:image/png;base64,', // Substituindo isso pela URL da sua imagem ou dados base64
      width: 100,

    });
    '\n\n'
    // Adicionando um cabeçalho ao documento PDF
    docContent.push({
      margin: [0, 0, -1, 0],
      alignment: 'center',
      text: '\n\n' + 'Relatório de Visualizações',
      fontSize: 12,
    });

    docContent.push({
      fontSize: 12,
      alignment: 'center',
      text: this.getNomeMes(this.mes) + ' de ' + this.ano + '\n\n\n',
      color: '#ef7102',
    });

    // Dividindo o conteúdo em duas colunas
    const colunas = [];
    const colunaMatricula = [];
    const colunaVisualizado = [];

    // Adicionando títulos às colunas
    colunaMatricula.push({text: 'Matrícula\n\n', fontSize: 12, bold: 'true',});
    colunaVisualizado.push({text:'Visualizado\n\n', fontSize: 12, bold: 'true',});

    // Adicionando detalhes de cada registro da coleção
    this.relatorioCollection.forEach((registro) => {
      // Adicionando os valores de matrícula e visualizado para cada registro
      colunaMatricula.push(registro.matricula + '\n\n' );
      colunaVisualizado.push(registro.visualizado + '\n\n');
    });

    // Adicionando as colunas ao conteúdo
    colunas.push({ text: colunaMatricula, alignment: 'center', fontSize: 10, width: '50%' });
    colunas.push({ text: colunaVisualizado, alignment: 'center', fontSize: 10, width: '50%' });

    // Adicionando as colunas ao conteúdo do documento
    docContent.push({
      columns: colunas,
    });

    // Criando o documento PDF
    const docDefinition = {
      content: docContent,
    };

    pdfMake.createPdf(docDefinition).open();
  }




}
